import "./App.css";
import { BrowserRouter } from "react-router-dom";
import {Result, Login} from "./components/Login";
import Quiz from "./components/Quiz";


function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>} />
      <Route path='/quiz' element={<Quiz/>} />
      <Route path='/result' element={<Result/>} />
    </Routes>
    </BrowserRouter>
  );
}

export default App;
